import{_ as a,o as e,c as t,e as o}from"./chunks/framework.nzJD8CNM.js";const p="/assets/room.nuyOY4wo.jpg",r="/assets/team.YO5Qfvjx.jpg",f=JSON.parse('{"title":"СМ-47","description":"Открытая столярная мастерская","frontmatter":{"title":"СМ-47","date":"2016-10-18","icon":"logo-black.png","cover":"place.webp","description":"Открытая столярная мастерская","city":"г. Москва","address":"просп. Мира, 119, строение 47","place":"ВДНХ","url":"https://www.sm-47.ru","email":"info@sm-47.ru","instagram":"sm47_vdnh","vk":"sm_47","tel":"+7 (926) 492-23-31","coord":[55.83699578150596,37.62422361224566],"status":"open","hours":"Понедельник - Пятница 11:00 - 20:00","youtube":"https://youtu.be/J2G6NAKKYJ4"},"headers":[],"relativePath":"workshop/archive/sm-47/index.md","filePath":"workshop/archive/sm-47/index.md"}'),s={name:"workshop/archive/sm-47/index.md"},i=o('<p>Реализуйте свой проект, идею, творческую задачу в нашей столярной мастерской. Вам в помощь - опытные мастера, качественный инструмент и материалы.</p><h3 id="столярныи-коворкинг" tabindex="-1">Столярный коворкинг <a class="header-anchor" href="#столярныи-коворкинг" aria-label="Permalink to &quot;Столярный коворкинг&quot;">​</a></h3><p>Мастерская укомплектована современным столярным инструментом: торцовочная, ленточная, циркулярная пилы, шлифовальные станки и диски, погружная пила, фрейзерный, токарный, сверлильный и фуговальный станок, электролобзики.</p><p>Оборудование и опыт наших мастеров-консультантов позволяют воплотить практически любой замысел.</p><h3 id="общественная-мастерская" tabindex="-1">Общественная мастерская <a class="header-anchor" href="#общественная-мастерская" aria-label="Permalink to &quot;Общественная мастерская&quot;">​</a></h3><p>Общественная ма­стер­ская, т.е. сто­ляр­ный ко­вор­кинг — это аренда ра­бо­чего ме­ста в ма­стер­ской, где Вы мо­жете из­го­то­вить то, что Вам нужно. Например, ме­бель из де­рева сво­ими ру­ками.</p><p>Ели Вы не уме­ете ни­чего, то мо­жете пройти обу­че­ние сто­ляр­ному делу на на­ших сто­ляр­ных кур­сах для на­чи­на­ю­щих «Креативная сто­лярка для на­чи­на­ю­щих за 4 дня» , а за­тем за­креп­лять на­выки и из­го­тав­ли­вать ме­бель из де­рева сво­ими ру­ками для дома или дачи в на­шей об­ще­ствен­ной ма­стер­ской в сво­бод­ном ре­жиме.</p><p>Для из­го­тов­ле­ния Вам по­на­до­бяться вер­стак, ин­стру­менты обо­ру­до­ва­ние, и, воз­можно, дель­ный со­вет (кон­суль­та­ция) ма­стера.</p><p>Наша об­ще­ствен­ная ма­стер­ская пред­ла­гает та­кую воз­мож­но­сть всем же­ла­ю­щим, у кого че­шутся руки, глаза го­рят, а сердце про­сит твор­че­ской ра­боты ру­ками! Особенно мы рады ви­деть тех, кто про­шел наши курсы, кого мы «за­ра­зили» сто­ляр­кой! Ребята при­хо­дите! С нас все­воз­мож­ные льгот­ные усло­вия для Вашего раз­ви­тия!</p><p><img src="'+p+'" alt=""></p><h3 id="инструменты-оборудование-материалы-и-фурнитура-общественнои-столярнои-мастерскои" tabindex="-1">Инструменты, оборудование, материалы и фурнитура общественной столярной мастерской <a class="header-anchor" href="#инструменты-оборудование-материалы-и-фурнитура-общественнои-столярнои-мастерскои" aria-label="Permalink to &quot;Инструменты, оборудование, материалы и фурнитура общественной столярной мастерской&quot;">​</a></h3><p>Мы по­сто­янно рас­ши­ряем тех­ни­че­скую базу ма­стер­ской. Однако, что бы это про­ис­хо­дило по­лез­нее именно для Вас про­сим при­сы­лать за­явки на те ин­стру­менты и обо­ру­до­ва­ние, ко­то­рые нужны именно Вам!</p><p>Так же мы все­гда го­товы рас­смот­реть ва­ри­ант ко­гда Вы по­ку­па­ете то, что нужно са­мо­сто­я­тельно, поль­зу­е­тесь, а за­тем мы вы­ку­паем у Вас это тех­ни­че­ское сред­ство!</p><p>С ма­те­ри­а­лом и фур­ни­ту­рой то же са­мое. Мы ре­шили нет смыслы за­ку­пать все под­ряд. Ибо ры­нок очень ве­лик. Лучше ко­гда Вы за­ра­нее остав­ля­ете за­явки на то что Вам нужно и мы ре­шаем этот во­прос. И, ко­нечно, Вы мо­жете при­во­зить свои ма­те­ри­алы, фур­ни­туру и ин­стру­мент.</p><p>Оставить за­явку можно в окошке об­рат­ной связи или по те­ле­фону 8 (926) 410 -38-91</p><p><strong>Варианты оплаты на работу в общественной столярной мастерской:</strong></p><p>19 000 рублей/аренда рабочего места в течение месяца (пн.-пт. с 11-00 до 20-00) 20 000 рублей/аренда рабочего места в течение 2-х месяцев/ 2 посещения в неделю (пн.-пт. с 11-00 до 20-00) 24 000 рублей/аренда рабочего места в течение 2-х месяцев/ 3 посещения в неделю (пн.-пт. с 11-00 до 20-00) 3500 рублей/аренда рабочего места в течение дня (пн.-пт. с 11-00 до 20-00)</p><p><strong>Что входит в стоимость:</strong></p><p>Аренда ра­бо­чего ме­ста в сто­ляр­ной ма­стер­ской, ин­стру­мент и обо­ру­до­ва­ние, чай-кофе, кон­суль­та­ция по про­екту. Для про­шед­ших курс Креативная сто­лярка так же вхо­дит пер­вич­ное обу­че­ние но­вому обо­ру­до­ва­нию.</p><p><strong>Что оплачивается отдельно:</strong></p><p>Для тех, кого мы пока не знаем так же есть по­ча­со­вое обу­че­ние. Материалы, фур­ни­тура — опла­чи­ва­ются от­дельно или при­во­зите свое. Обучение сто­ляр­ному делу в груп­пах Индивидуальное обу­че­ние Приходите к нам в нашу об­ще­ствен­ную ма­стер­скую и ре­а­ли­зуйте свои идеи вме­сте с нами!</p><h4 id="мастерская-оборудована-современным-инструментом-и-станками" tabindex="-1">МАСТЕРСКАЯ ОБОРУДОВАНА СОВРЕМЕННЫМ ИНСТРУМЕНТОМ И СТАНКАМИ <a class="header-anchor" href="#мастерская-оборудована-современным-инструментом-и-станками" aria-label="Permalink to &quot;МАСТЕРСКАЯ ОБОРУДОВАНА СОВРЕМЕННЫМ ИНСТРУМЕНТОМ И СТАНКАМИ&quot;">​</a></h4><p>Мастерская укомплектована современным высокоточным столярным инструментом: торцовочная, ленточная, циркулярная пилы, шлифовальные станки и диски, погружная пила, фрейзерный, токарный, сверлильный и фуговальный станок, электролобзики. Оборудование и опыт наших мастеров-консультантов позволяют воплотить практически любой замысел.</p><h4 id="мы-обеспечиваем-все-необходимое-для-качественнои-реализации-вашего-проекта" tabindex="-1">МЫ ОБЕСПЕЧИВАЕМ ВСЕ НЕОБХОДИМОЕ ДЛЯ КАЧЕСТВЕННОЙ РЕАЛИЗАЦИИ ВАШЕГО ПРОЕКТА <a class="header-anchor" href="#мы-обеспечиваем-все-необходимое-для-качественнои-реализации-вашего-проекта" aria-label="Permalink to &quot;МЫ ОБЕСПЕЧИВАЕМ ВСЕ НЕОБХОДИМОЕ ДЛЯ КАЧЕСТВЕННОЙ РЕАЛИЗАЦИИ ВАШЕГО ПРОЕКТА&quot;">​</a></h4><p>Мы обеспечиваем вас необходимыми материалами, фанерой, ценными породами дерева качественной сушки, заготовками для творческой работы. Вы не будете испытывать недостаток в расходных материалах: шкурки, клеи, экологически чистые краски, покрытия и лаки.</p><h4 id="наш-подход-позволяет-вам-быстро-освоится-и-начать-работать" tabindex="-1">НАШ ПОДХОД ПОЗВОЛЯЕТ ВАМ БЫСТРО ОСВОИТСЯ И НАЧАТЬ РАБОТАТЬ <a class="header-anchor" href="#наш-подход-позволяет-вам-быстро-освоится-и-начать-работать" aria-label="Permalink to &quot;НАШ ПОДХОД ПОЗВОЛЯЕТ ВАМ БЫСТРО ОСВОИТСЯ И НАЧАТЬ РАБОТАТЬ&quot;">​</a></h4><p>ШАГ 1. ЗНАКОМСТВО С МАСТЕРСКОЙ</p><p>ШАГ 2. ИНСТРУКТАЖ ПО БЕЗОПАСНОСТИ</p><p>ШАГ 3. КОНСУЛЬТАЦИЯ ПО РАБОТЕ С ИНСТРУМЕНТОМ</p><p>ШАГ 4. ПОМОЩЬ МАСТЕРА - КУРАТОРСТВО</p><p><img src="'+r+'" alt=""></p>',31),n=[i];function c(h,l,d,_,m,u){return e(),t("div",null,n)}const g=a(s,[["render",c]]);export{f as __pageData,g as default};
